import React, { Component } from 'react';
import './main.css';

export default class Main extends Component {
  render() {
    return (
      <div className="container mx-auto p-40">
        <h1 className="text-6xl text-white font-bold leading-none">SCOTT<br/>CARDOZA</h1>
        <a className="text-white p-2" rel="noopener noreferrer" href="https://github.com/scdozer/" target="_blank"><i className="fa fa-github" aria-hidden="true"></i></a>
        <a className="text-white p-2" rel="noopener noreferrer" href="https://www.linkedin.com/in/scott-cardoza-b5497974/" target="_blank"><i className="fa fa-linkedin-square" aria-hidden="true"></i></a>
        <a className="text-white p-2" rel="noopener noreferrer" href="https://www.instagram.com/dozeydozerr/" target="_blank"><i className="fa fa-instagram" aria-hidden="true"></i></a>
        <a className="text-white p-2" rel="noopener noreferrer" href="mailto:scott@scottcardoza.com" target="_blank"><i className="fa fa-envelope-o" aria-hidden="true"></i></a>

        <p className="text-5xl text-gray-100 py-20 font-bold">I enjoy making things for the web.</p>
      </div>
    )
  }
}
